# Convert to RGB values
def convert_to_rgb(hx):
    if re.compile(r'#[a-fA-F0-9]{3}').match(hx):
        div = 0
        return tuple(int(hx[i:i + 2], 16) / div if div else
                     int(hx[i:i + 2], 16) for i in (1, 3, 5))
    else:
        raise ValueError(f'"{hx}" <-- wtf is that?')


# Call with game and desired frame, return frame data array

def play(game):
    origdata = GameFrames.get(game)
    framedata = []
    for f in range(len(origdata)):
        framedata.append([])
        for i in range(256):
            framedata[f].append(convert_to_rgb(origdata[f][i]))
    return framedata
